import React from "react";

export default class CardsContainer extends React.Component{
    componentDidMount(){
        fetch(`http://www.nyartbeat.com/list/event_searchNear?latitude=40.721952&longitude=-74.000144&MaxResults=5&SortOrder=distance`,{
            headers: {
                "Access-Control-Allow-Origin": null
            }
        })
        .then(resp => resp.json())
        .then(console.log)
    }
    render(){
        return (
            <div>
                <h1>Some text</h1>
                <p>render cards</p>
                <a>More info</a>
            </div>
        );
    }
}
